                    "tooltip": "\u81ea\u52a8\u5316 T2",
                    "data": "\u4f60\u60f3\u8981\u6bd4\u7ba1\u9053\u66f4\u597d\u7684\u81ea\u52a8\u5316\u5417\uff1f\u80af\u5b9a\u662f,\u5236\u4f5c\u4e00\u4e2a\u7ea2\u77f3\u6bd4\u8f83\u5668,\u5e76\u5c06\u7ea2\u77f3\u94fa\u8bbe\u5728\u5730\u9762\u4e0e\u4e4b\u8fde\u7ed3.\u7ea2\u77f3\u5fc5\u987b\u8fde\u63a5\u6d47\u6ce8<br/>\u53e3\u6765\u542f\u52a8\u5236\u9020\u7a0b\u5e8f.",
