                    "data": "\u5728\u4f60\u6709\u80fd\u529b\u50a8\u5b58\u5927\u91cf\u7684\u80fd\u6e90\u540e,\u5bfb\u627e\u751f\u4ea7\u5927\u91cf\u80fd\u6e90\u65b9\u6cd5\u7684\u5fc5\u8981\u6027\u5c31\u5f00\u59cb\u663e\u73b0\u51fa\u6765\u4e86. \u4f60\u9700\u8981\u4e00\u53f0\u5927\u578b\u9752\u94dc\u9505\u7089.<br/>\u4f46\u4e3a\u4e86\u5236\u9020\u8fd9\u4e2a\u9505\u7089,\u4f60\u9700\u8981\u50cf\u5c71\u4e00\u6837\u591a\u7684\u9752\u94dc.\u8fd9\u4e2a\u9505\u7089\u6bcftick\u80fd\u4ea7\u751f800L\u7684\u84b8\u6c7d,\u8fd9\u8db3\u4ee5\u4f9b\u5e94\u5341\u53f0\u57fa<br/>\u7840\u84b8\u6c7d\u8f6e\u673a\u8fd0\u4f5c\u4e86.\u5927\u578b\u9505\u7089\u65e2\u53ef\u4ee5\u7528\u6c34\u4e5f\u53ef\u4ee5\u7528\u84b8\u998f\u6c34. \u6bcf\u4ea7\u751f150L\u84b8\u6c7d,\u4f1a\u6d88\u80171L\u6c34.\u5927\u578b\u9505\u7089\u7684\u7ed3<br/>\u6784\u90fd\u662f\u7c7b\u4f3c\u7684,\u4ee5\u5927\u578b\u9752\u94dc\u9505\u7089\u4e3a\u4f8b. \u6574\u4f53\u5c3a\u5bf8\u4e3a3x5x3,\u6700\u4e0b\u5c42\u4e3a3x1x3\u7684\u9752\u94dc\u71c3\u70e7\u5ba4,\u5305\u542b1-2<br/>\u4e2a\u8f93\u5165\u4ed3\u30011-2\u4e2a\u8f93\u5165\u603b\u7ebf\u30011\u4e2a\u6d88\u58f0\u4ed3\u548c\u4e00\u4e2a\u7ef4\u62a4\u4ed3. \u6240\u6709\u4ed3\u5ba4\u7684\u80cc\u9762\u90fd\u9700\u8981\u63a5\u89e6\u5230\u71c3\u70e7\u5ba4.\u71c3\u70e7\u5ba4\u4e2d\u592e\u4e0a<br/>\u65b9\u9700\u8981\u642d\u5efa1x3x1\u7684\u9752\u94dc\u7ba1\u9053\u65b9\u5757\u67f1,\u5468\u56f4\u662f3x4x3\u7684\u9540\u94dc\u7816\u5757.\u8f93\u51fa\u4ed3\u53ef\u4ee5\u66ff\u6362\u4efb\u610f\u7684\u9540\u94dc\u7816\u5757.\u8b66\u544a<br/>: \u4e0d\u540c\u4e8e\u5176\u4ed6\u9505\u7089,\u5927\u578b\u9505\u7089\u5728\u8fd0\u884c\u65f6\u5fc5\u987b\u5168\u7a0b\u4fdd\u6301\u6709\u6c34. \u8fd0\u884c\u4e2d\u4efb\u610f\u65f6\u523b\u7f3a\u6c34,\u90fd\u4f1a\u5bfc\u81f4\u7206\u70b8.",
