                    "symbolSize": 57.599999999999994,
                    "x": 516.0,
                    "y": 552.0,
                    "tooltip": "No More (IC) Engraving",
                    "data": "Now that you've reached ZPM, you're going to have <br/>to resort to means other than mere laser engraving<br/> for your photolithography needs.\n\nOf course, we'r<br/>e going overkill right away, requiring a full-on p<br/>article accelerator setup to produce the ultra-coh<br/>erent ultra-high-energy light used to etch more ad<br/>vanced ICs.\n\nTo begin with, you'll need a Source C<br/>hamber to produce electrons (at pitifully low ener<br/>gies, of course). Check out NEI for the available <br/>recipes, you'll want the one with the hand-drawn i<br/>con.\n\n",
                    "quest_id": "isBmh7T0Sr63O2m5N4pCIQ=="
