                    "tooltip": "2\u9636PCB\u5de5\u5382",
                    "data": "\u968f\u7740\u7eb3\u7c73\u953b\u7089\u7684\u843d\u6210,\u6211\u4eec\u53ef\u4ee5\u514d\u8d39\u63d0\u5347\u57fa\u677f\u4ea7\u91cf\u4e86,\u4f46\u7eb3\u7c73\u8702\u7fa4\u9700\u8981\u5bb9\u5668.\u73b0\u6709\u7684\u673a\u68b0\u65b9\u5757\u8fd8\u4e0d\u8db3\u4ee5\u627f\u8f7d,\u6211\u4eec<br/>\u8fd8\u9700\u8981\u53e6\u884c\u5bfb\u627e.\u7ecf\u8fc7\u4e00\u4e9b\u7814\u7a76,\u4ee5\u65e0\u5c3d\u4e3a\u6846\u67b6,\u4ee5\u5bcc\u96c6\u94ac\u4e3a\u9694\u5c42\u7684\u673a\u68b0\u65b9\u5757\u4f3c\u4e4e\u5de5\u4f5c\u826f\u597d.\u5b83\u53ef\u4ee5\u8ba9\u7eb3\u7c73\u8702\u7fa4\u901a<br/>\u8fc7\u76f4\u8fbe\u5370\u5236\u673a\u6784\u57fa\u5ea7,\u8fd9\u6837\u53ef\u4ee5\u76f4\u63a5\u53bb\u9664\u591a\u4f59\u7684\u6750\u6599,\u800c\u65e0\u9700\u964d\u901f.\u5728\u8f93\u5165\u603b\u7ebf\u4e2d\u653e\u5165\u94f6\u7eb3\u7c73\u8702\u7fa4,\u53ef\u89e3\u95012\u9636\u914d<br/>\u65b9.\u540c\u65f6\u53ef\u89e3\u9501PCB\u5de5\u5382\u7684\u5e76\u884c,\u516c\u5f0f\u5982\u4e0b\uff1a\u5e76\u884c=Log2(\u7eb3\u7c73\u8702\u7fa4\u6570).",
