                    "tooltip": "\u5927\u7537\u5b69,\u54b1\u4eec\u6765\u73a9\u73a9\u5316\u5de5\u5427",
                    "data": "\u8be5\u8bbe\u65bd\u5c06\u4e3a\u4f60\u5904\u7406\u7a0d\u540e\u9700\u8981\u7684\u67d0\u4e9b\u5316\u5b66\u914d\u65b9.\u6bd4\u5982\u706b\u7bad\u71c3\u6599. \u6ce8\u610f,\u53ea\u6709\u8fbe\u5230\u914d\u65b9\u6240\u9700\u5316\u5de5\u5382\u7b49\u7ea7\u624d\u80fd\u8fd0\u884c\u76f8\u5e94<br/>\u914d\u65b9.\u800c\u4e14\u5316\u5de5\u5382\u9700\u8981\u5927\u91cf\u8d44\u6e90,\u5f00\u59cb\u91c7\u77ff\u5427! \u67d0\u4e9b\u914d\u65b9\u9700\u8981\u50ac\u5316\u5242,\u5c06\u5b83\u4eec\u653e\u5728\u50ac\u5316\u5242\u4ed3\u5185. \u50ac\u5316\u5242\u6d88\u8017\u8010<br/>\u4e45,\u5305\u62ec\u770b\u8d77\u6765\u6ca1\u6709\u8010\u4e45\u7684.\u78b3\u5316\u7845\u53ef\u5728\u6405\u62cc\u673a\u4e2d\u83b7\u5f97,\u4e0d\u4e00\u5b9a\u9700\u8981\u5408\u91d1\u51b6\u70bc\u7089.\u53ef\u7528\u7684\u56fa\u4f53\u5916\u58f3:(\u51b3\u5b9a\u53ef\u5904\u7406<br/>\u7684\u914d\u65b9\u7b49\u7ea7)1 \u5f3a\u5316\u9752\u94dc\u673a\u68b0\u65b9\u57572 \u8131\u6c27\u94a2\u673a\u68b0\u65b9\u57573 \u5f3a\u5316\u94dd\u673a\u68b0\u65b9\u57574 \u6d01\u51c0\u4e0d\u9508\u94a2\u673a\u68b0\u65b9\u57575 \u52a0\u5f3a\u949b<br/>\u673a\u68b0\u65b9\u57576 \u5f3a\u5316\u94a8\u94a2\u673a\u68b0\u65b9\u57577 \u5f3a\u5316\u52b3\u4f26\u59c6\u5408\u91d1\u673a\u68b0\u65b9\u57578 \u5f3a\u5316\u535a\u7279\u59c6\u5408\u91d1\u673a\u68b0\u65b9\u5757\u53ef\u7528\u7684\u673a\u68b0\u65b9\u5757:(\u51b3<br/>\u5b9a\u4ed3\u5ba4/\u603b\u7ebf\u7684\u7b49\u7ea7\u4e0a\u9650)ULV-UHV\u673a\u68b0\u65b9\u5757(UHV\u5373\u53ef\u89e3\u9501\u6240\u6709\u4ed3\u5ba4/\u603b\u7ebf)\u53ef\u7528\u7684\u7ba1\u9053\u65b9\u5757:(\u4ece2<br/>\u5e76\u884c,100%\u50ac\u5316\u5242\u6d88\u8017\u51e0\u7387\u5f00\u59cb,\u6bcf\u7ea7\u7ba1\u9053\u65b9\u5757\u63d0\u5347+2\u5e76\u884c,-20\uff05\u50ac\u5316\u5242\u6d88\u8017\u51e0\u7387)\u9752\u94dc\u94a2\u949b\u94a8\u94a2\u4ece\u767d<br/>\u94dc\u7ebf\u5708\u5230\u6c38\u6052\u7ebf\u5708,\u6240\u6709\u7b49\u7ea7\u7ebf\u5708\u90fd\u53ef\u7528.\u6bcf\u4e2a\u7b49\u7ea7\u63d0\u901f+50\uff05,\u521d\u59cb\u901f\u5ea6(\u767d\u94dc\u7ebf\u5708)\u4e3a50\uff05.\u53e6\u5916:\u4f7f\u7528<br/>\u89c9\u9192\u9f99\u952d\u53ca\u4ee5\u4e0a\u7b49\u7ea7\u7684\u7ebf\u5708+\u94a8\u94a2\u7ba1\u9053\u65b9\u5757,\u4e0d\u4f1a\u6d88\u8017\u50ac\u5316\u5242\u8010\u4e45.",
