                    "data": "RC\u7684\u9505\u7089\u662f\u53e6\u4e00\u79cd\u4ea7\u751f\u84b8\u6c7d\u7684\u65b9\u6cd5. RC\u9505\u7089\u662f\u4e00\u79cd\u591a\u65b9\u5757\u7ed3\u6784,\u6700\u5c11\u9700\u8981\u4e00\u4e2a\u71c3\u70e7\u5ba4.\u6709\u591a\u79cd\u5c3a\u5bf8\u53ef\u9009:1<br/>x1(\u4efb\u52a1\u8981\u4f60\u505a\u7684)\u8fd8\u67092\u00d72\u548c3\u00d73.\u5411\u71c3\u70e7\u5ba4\u63d0\u4f9b\u6c34\u548c\u71c3\u6599,\u786e\u4fdd\u4f60\u7684\u6c34\u6e90\u6e90\u4e0d\u7edd,\u5426\u5219BOOM!\u6bcf\u4e00<br/>\u53f0\u9505\u7089\u90fd\u9700\u8981\u6839\u636e\u71c3\u70e7\u5ba4\u7684\u5c3a\u5bf8\u914d\u7f6e\u76f8\u5e94\u6570\u91cf\u7684\u4f4e\u538b\u6216\u8005\u9ad8\u538b\u9505\u7089\u65b9\u5757\u624d\u80fd\u6b63\u5e38\u5de5\u4f5c(1\u00d71\u914d\u7f6e1\u5c42\u9505\u7089\u65b9\u5757\u3001<br/>2\u00d72\u914d\u7f6e2\u5c42\u30013\u00d73\u914d\u7f6e3\u5c42)-\u89c1\u6b64\u4efb\u52a1\u7ebf\u4e0b\u4e00\u4e2a\u4efb\u52a1.WIKI \u84b8\u6c7d\u673a\uff1agtnh.huijiwik<br/>i.com/p/875",
