                    "tooltip": "Synchrotron (No Relation to the Catalyst)",
                    "data": "To actually produce some light for photolithograph<br/>y, you'll need to accelerate your electrons in a S<br/>ynchrotron. Like with the LINAC, providing it with<br/> coolant is necessary to keep it running.\n\nYou can<br/> increase the energy of the produced photons by in<br/>creasing EU/t, or increasing the tier of all four <br/>Antenna Casings inside.\n\nTo improve focus, you can<br/> use a better coolant, and the output amount incre<br/>ases with both EU/t and antennae tier.\n\nYes, you n<br/>eed all four energy hatches.",
