                    "y": 300.0,
                    "tooltip": "UV\u73bb\u7483",
                    "data": "\u4e0b\u4e00\u9636\u787c\u73bb\u7483\u9700\u8981\u63ba\u6742\u9507(8). \u66f4\u9ad8\u9636\u7684\u73bb\u7483\u53ef\u4ee5\u8ba9\u7ec6\u83cc\u57f9\u517b\u7f38\u652f\u6301\u66f4\u9ad8\u9636\u7684\u914d\u65b9,\u8ba9\u5de8\u578b\u5de5\u4e1a\u9ad8\u7089\u652f\u6301\u9ad8\u9636<br/>\u80fd\u6e90\u4ed3,\u4e5f\u80fd\u4f7f\u5170\u6ce2\u987f\u8d85\u7ea7\u7535\u5bb9\u5e93\u652f\u6301\u66f4\u9ad8\u9636\u7684\u7535\u5bb9. \u6216\u4ec5\u7528\u4e8e\u5236\u9020\u673a\u5668.",
