                    "tooltip": "\u4f60\u7684\u65b0\u670b\u53cb",
                    "data": "\u5728\u7269\u54c1\u680f\u91cc\u643a\u5e26\u6240\u6709\u5de5\u5177\u662f\u4e00\u79cd\u4e0d\u592a\u6109\u5feb\u7684\u4f53\u9a8c.\u4f60\u53ef\u4ee5\u5c06GT\u5de5\u5177\u4ee5\u53ca\u7535\u70d9\u94c1(\u5305\u62ec\u710a\u6599)\u653e\u5165IC2\u7684\u5de5\u5177\u7bb1<br/>\u4e2d,\u4ee5\u8282\u7701\u7269\u54c1\u680f\u7a7a\u95f4.\u4f60\u8fd8\u53ef\u4ee5\u76f4\u63a5\u7528\u5de5\u5177\u7bb1\u8fdb\u884c\u7ef4\u62a4\u5de5\u4f5c,\u800c\u65e0\u9700\u4f9d\u6b21\u4f7f\u7528\u5176\u4e2d\u5de5\u5177.\u53ea\u9700\u624b\u6301\u5de5\u5177\u7bb1\u53f3\u952e\u7ef4<br/>\u62a4\u4ed3\u5373\u53ef.\u73b0\u5728\u8c01\u8fd8\u8981\u822a\u7a7a\u80f6\u5e26\u554a? (\u597d\u5427,\u4f60\u8fd8\u9700\u8981\u7528\u5b83\u6765\u5408\u6210\u81ea\u52a8\u7ef4\u62a4\u4ed3.)",
